import React from "react";
import {Link} from "react-router-dom";
import "./header.css";
import {logout} from "../../store/user/actions";

export const Header = () => {
    const onclickLogout = () => {
        // window.location = 'http://localhost:3000/login';
        location.reload();
        localStorage.clear();
    };
    return (

        <div className="header">
            <div className="logout">
                <Link to="/login" onClick={onclickLogout}>
                    <img className="logout"
                         src="https://cdn0.iconfinder.com/data/icons/large-glossy-icons/512/Logout.png"
                         alt="logout"/>
                </Link>
            </div>
            <h1><img className="logo" src="https://www.homesteadletters.com/wp-content/uploads/2010/07/yck7BoXcE.jpeg"
                     alt=""/></h1>
        </div>
    )
};
